import React from "react";
import { useParams } from "react-router-dom";

const Fullcard = ({ data }) => {
  const { id } = useParams();
  return (
    <section className="full">
      <div className="container">
        {data
          .filter((card) => card.id === id)
          .map((card) => {
            return (
              <div key={card.id} className="card">
                <h1>{card.name}</h1>
                <p>{card.website}</p>
              </div>
            );
          })}
      </div>
    </section>
  );
};

export default Fullcard;
